    return (
        <div className={styles.TodoListContainer}>
            {!todos.length && <h2>Нет задач</h2>}
            {todos.map((todo) => 
            <Todos key={todo.id} todo={todo} index={index} deleteTodo={deleteTodo}/>)}
        </div>
    )
}

export default TodosList;
